@stevemessick there's a new `flutter build ios --config-only` flag https://github.com/flutter/flutter/pull/64848 available in `1.22.0-12.0.pre` which will set up the Xcode project, but not actually compile anything.

https://github.com/flutter/flutter-intellij/blob/aef6bd5e9287b21d3ef5c2167991724916e11edd/src/io/flutter/actions/OpenInXcodeAction.java#L80 

The user will still need to go into Xcode and swap their scheme.  But at least they won't see any errors.
